  `cumplen_renta` tinyint(1) DEFAULT '0',
  `fase_solicitud` enum('borrador','validada','baremada') DEFAULT 'validada',
  `transporte` int(11) DEFAULT '2',
  `nasignado` int(11) DEFAULT '0',
  `nordensorteo` int(11) DEFAULT '0',
