  `sol_vacantes` tinyint(4) DEFAULT '0',
  `hore` enum('7:45','8:30','9:00','9:30') DEFAULT '7:45',
  `hors` enum('13:00','16:00','17:00') DEFAULT '17:00',
  `importe_renta` float DEFAULT '0',
  `puntos_renta` float DEFAULT '0',
  `cuota` float DEFAULT '0',
  `tipoalumno` enum('anterior','nuevo') DEFAULT 'nuevo',
  `nodatos` tinyint(4) DEFAULT '0',
  `anexo4` enum('si','no') DEFAULT 'no',
  `nmunidad` int(11) DEFAULT '0',
  `validar_infotributaria` tinyint(4) DEFAULT '0',
  `solcalcbon` tinyint(4) DEFAULT '0',
  `token` char(200) DEFAULT 'notoken',
  `firma` tinyint(4) DEFAULT '0',
  `fecha_inscripcion` datetime DEFAULT CURRENT_TIMESTAMP
